import React, { useCallback } from 'react';
import { Link } from 'react-router-dom';
import Particles from "react-tsparticles";
import { loadSlim } from "tsparticles-slim";

const HomePage = () => {
  const services = [
    { icon: 'ðŸ“±', title: 'Social Media' },
    { icon: 'ðŸŒ', title: 'Web Development' },
    { icon: 'ðŸ“²', title: 'App Development' },
    { icon: 'ðŸŽ¯', title: 'Ad Campaigns' },
    { icon: 'ðŸŽ¨', title: 'Graphic Design' },
    { icon: 'ðŸŽžï¸', title: 'Video Editing' },
  ];

  const particlesInit = useCallback(async engine => {
    await loadSlim(engine);
  }, []);

  const particlesOptions = {
    background: {
      color: {
        value: '#111827', // obsidian
      },
    },
    fpsLimit: 60,
    interactivity: {
      events: {
        onHover: {
          enable: true,
          mode: 'repulse',
        },
        resize: true,
      },
      modes: {
        repulse: {
          distance: 100,
          duration: 0.4,
        },
      },
    },
    particles: {
      color: {
        value: '#374151', // dark
      },
      links: {
        color: '#374151', // dark
        distance: 150,
        enable: true,
        opacity: 0.2,
        width: 1,
      },
      move: {
        direction: 'none',
        enable: true,
        outModes: 'out',
        random: false,
        speed: 1,
        straight: false,
      },
      number: {
        density: {
          enable: true,
          area: 800,
        },
        value: 50,
      },
      opacity: {
        value: 0.2,
      },
      shape: {
        type: 'circle',
      },
      size: {
        value: { min: 1, max: 5 },
      },
    },
    detectRetina: true,
  };

  return (
    <div className="relative">
      <Particles
        id="tsparticles"
        init={particlesInit}
        options={particlesOptions}
        className="absolute inset-0 z-0"
      />
      <div className="relative z-10">
        {/* Hero Section */}
        <section className="text-center container mx-auto pt-24 pb-16">
          <h1 className="text-4xl md:text-6xl font-extrabold text-light mb-4 leading-tight">
            Creative Digital Solutions<br /> for Growing Brands.
          </h1>
          <p className="text-lg md:text-xl text-gray-400 mb-8 max-w-3xl mx-auto">
            We combine data-driven strategy with creative storytelling to help your business stand out in a crowded digital world.
          </p>
          <div className="flex gap-4 justify-center">
            <Link to="/services" className="px-8 py-3 bg-primary text-white rounded-lg font-semibold shadow-lg hover:bg-teal-600 transition-colors transform hover:scale-105">
              Our Services
            </Link>
            <Link to="/portfolio" className="px-8 py-3 bg-accent text-light rounded-lg font-semibold shadow-lg hover:bg-gray-700 transition-colors transform hover:scale-105">
              View Our Work
            </Link>
          </div>
        </section>

        {/* Services Overview */}
        <section className="text-center container mx-auto">
          <h2 className="text-3xl font-bold mb-2">What We Do</h2>
          <p className="text-gray-500 mb-10">A brief overview of our core services.</p>
          <div className="grid grid-cols-2 md:grid-cols-3 lg:grid-cols-6 gap-8">
            {services.map(service => (
              <div key={service.title} className="p-4 bg-white rounded-lg shadow-sm hover:shadow-xl transition-shadow">
                <div className="text-4xl mb-3">{service.icon}</div>
                <h3 className="font-semibold">{service.title}</h3>
              </div>
            ))}
          </div>
        </section>

        {/* Testimonials */}
        <section className="container mx-auto py-16">
          <div className="max-w-3xl mx-auto text-center">
            <h2 className="text-3xl font-bold text-light mb-10">Loved by Our Clients</h2>
            <div className="bg-accent p-8 rounded-xl shadow-lg relative">
              <p className="text-lg italic text-gray-300">
                "Shyara has been the perfect partner for my business. Their social media marketing service helped us go from 0 to 5K followers with genuine engagement."
              </p>
              <p className="mt-4 font-semibold text-gray-200">â€” Ritika Sharma, Boutique Owner</p>
            </div>
          </div>
        </section>
      </div>
    </div>
  );
};

export default HomePage;
